DexOffline is an application that helps you find words in DEX (the Romanian language dictionary) without being online, play Hangman, Pheasant or Wordle games and much more.

Features:
- Search words in offline and online Romanian dictionaries (you can change the search strategy from Settings);
- Possibility to search exactly the words with diacritics if the quotation marks are used;
- Save the searched words;
- Check if a word is in the official word list for the Scrabble game;
- Browse and filter the words in the dictionary;
- Read the feed with words of the day;
- Play Hangman game (you can configure the length of the guess word in Settings);
- Play Pheasant game (write the word that starts with the last 2 letters of the previous word);
- Play Wordle game (guess the word from at most 6 tries, green letter means the letter was matched in the right position, yellow letter means the letter is in the word, but not in the right position);
- Ability to change the display language and choose a dark theme from Settings.

All suggestions to improve the app and add new functionality are welcome.

"Fishing Knots" - is a program for your mobile device, showing how to tie knots.

Among the many knots fisherman should select and use the right one. In each case - his own. How the knot weakens the fishing line? Which knots to use for thin fishing lines, and which - for thick? Which knots can be knit on multifilament fishing line?

The encyclopedia contains different type of knots for: binding of two fishing lines; tying leads; attach large and small hooks, baits, lures, swivels; connection fishing lines and the binding cord; tie a boat and etc.; 

For each knot, tying methods is described in detail. Also description of each knot contains step-by-step guide "How to tie" with illustrations.

Describes in detail the properties of knots. The estimation of the strength reduction for each knot. For each knot provides recommendations for types of fishing lines.

The application can also work without the Internet, all the nodes are loaded during installation.

Selected knots are simple and clear three-dimensional scheme - this is the app "Fishing knots".

Here are a few reasons to install into your device "Fishing Knots":
 - The maximum number of knotes used by fishermen;
 - Graphics extensively tested for intelligibility;
 - The application can run without an Internet connection;
 - Easy to use interface - this is not a website page with a bunch of useless information at the edges;
 - Knots are clearly defined by categories;
 - Each record contain relative knot strength - the breaking strength of a knotted rope in proportion to the breaking strength of the rope without the knot;
 - It is always being updated, refined and increasing.

